import React from 'react';

class Homepage extends React.Component {

    render() {
        return(
            <div class="d-flex flex-row">
                <div class ="p-2">
                    <img src="" class="img-fluid poster" alt="Loading..." height="100" id="Poster0" />
                </div>
                <div class="p-2">
                    <img src="" class="img-fluid poster" alt="Loading..." height="100" id="Poster1" />
                </div>
                <div class="p-2">
                    <img src="" class="img-fluid poster" alt="Loading..." height="100" id="Poster2" />
                </div>
                <div class="p-2">
                    <img src="" class="img-fluid poster" alt="Loading..." height="100" id="Poster3" />
                </div>
                <div class="p-2">
                    <img src="" class="img-fluid poster" alt="Loading..." height="100" id="Poster4" />
                </div>
            </div>

        )

    }

   
}

export default Homepage;
